  var loadingDots = `<div class="loading-dots">
                        <div></div>
                        <div></div>               
                        <div></div>               
                        </div>`;
  var loadingHTML = `<div class="initial-loading-page">${Logo_default}${loadingDots}</div>`;
  var dotInterval = null;
  function changeLoading() {
    const loading = document.querySelector(".initial-loading-page");
    console.log(loading);
    setTimeout(() => {
      loading.style.display = "none";
      clearInterval(dotInterval);
      console.log("changed");
    }, 0);
  }
  var sleep = (milliseconds) => {
    return new Promise((resolve) => setTimeout(resolve, milliseconds));
  };
  async function dotLoading() {
    const dots = document.querySelector(`.loading-dots`);
    let notFilled = true;
    const fillDots = async () => {
      for (let i = 0; i < 3; i += 1) {
        await sleep(200);
        dots.children[i].style.background = "white";
        if (i === 2) {
          notFilled = false;
        }
      }
    };
    const emptyDots = async () => {
      for (let i = 0; i < 3; i += 1) {
        await sleep(200);
        dots.children[i].style.background = "#6526d1";
        if (i === 2) {
          notFilled = true;
        }
      }
    };
    fillDots();
    dotInterval = setInterval(() => {
      if (notFilled) {
        fillDots();
      } else {
        emptyDots();
      }
    }, 350 * 3);
  }
  var LoadingIntro = {
    html: loadingHTML,
    autoRunFunctions: [changeLoading, dotLoading]
  };
